CREATE TABLE knowmebetter.politic (
id SERIAL PRIMARY KEY,
optlock TIMESTAMP (3) NOT NULL DEFAULT CURRENT_TIMESTAMP(3),
nom VARCHAR(255),
prenom VARCHAR(255),
twitteraccount VARCHAR(70),
politicalparty VARCHAR(55)
);

CREATE TABLE knowmebetter.friend (
id SERIAL PRIMARY KEY,
optlock TIMESTAMP (3) NOT NULL DEFAULT CURRENT_TIMESTAMP(3),
twitteraccount VARCHAR(255)
);

